String selectName(){
  String name = "";
  Serial.print("Pon tus iniciales");
  tft.setCursor(40, 50);
  tft.setTextSize(2);
  tft.println("Nuevo puntaje mas alto, ingrese su nombre");
  for (int i = 0; i < 3; i++){
    bool selec = false;
    int letraN = 0;
    int posicion[] = {37, 127, 217};
    bool letraM = false; // Indica si la letra ya se printeo en la TFT
    while (selec == false){
      if (letraM == false) mostrarLetra(posicion[i], letraN);
      letraM = true;
      char key = keypad.getKey();
      //Se presiona la flecha ->
      if (key){
        if (key == '4'){
          if (letraN == 25){
            letraN = 0;
          }
          else{
            letraN++;
          }
          Serial.print(letraN);
          letraM = false;
        }
        //Se presiona la flecha <-
        else if (key == '*'){
          if (letraN == 0){
            letraN = 25;
          }
          else{
            letraN--;
          }
          Serial.print(letraN);
          letraM = false;
        }
        //Se presiona Enter
        else if (key == '7'){
          name += letras[letraN];
          Serial.print(name);
          selec = true;
        }
      }
    }
  }
  return name;
}
